import Conatiner from "../components/Container";
import Head from "next/head";
export default function Services() {
  return (
    <Conatiner>
      <Head>
        <title>Services - Nextjs</title>
      </Head>
      <h1>Services</h1>
      <p>
        Lorem ipsum, dolor sit amet consectetur adipisicing elit. Temporibus
        animi laborum incidunt dignissimos debitis? Qui commodi ratione placeat
        unde animi totam? Sapiente, explicabo cumque quae voluptatem fugiat
        quibusdam voluptatibus omnis!
      </p>
    </Conatiner>
  );
}
